import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  titulo: {
    border: "1px solid #FFF",
    borderRadius: "200px",
    width: "fit-content",
    padding: "10px 40px",
    color: "#FFF",
    fontSize: "18px",
    letterSpacing: "1.5px",
  },

  header: {
    background: theme.palette.primary.main,
    display: "flex",
    justifyContent: "center",
    padding: "15px",
    maxHeight: "75px",
  },

  gridAvatar: {
    background: theme.palette.primary.main,
    padding: "15px",
  },
  gridContainer: {
    height: "100vh",
  },
}));
